import '../components/HomePage/_homepage.sass';
import React from 'react';
import Header from '../components/Header/Header';
import Footer from '../components/Footer/Footer';
import { Helmet } from 'react-helmet';
import './HomePage.sass';
import ServiceCard from '../components/ServiceCard/ServiceCard';

const HomePage: React.FC = () => {
    return (
        <div className="container">
            <Helmet>
                <title>Home</title>
            </Helmet>
            <Header title="Welcome" />
            <div className="content">
                <HeroSection />
                <AboutSection />
                <ServicesSection />
                <ContactSection />
            </div>
            <Footer />
        </div>
    );
};

const HeroSection: React.FC = () => (
    <section className="hero">
        <h1>Welcome to My Portfolio</h1>
        <p>Discover my work and projects</p>
        <button className="cta-button">Get Started</button>
    </section>
);

const AboutSection: React.FC = () => (
    <section className="about">
        <h2>About Me</h2>
        <p>I'm a passionate developer with experience in various technologies...</p>
    </section>
);

const ServicesSection: React.FC = () => (
    <section className="services">
        <h2>My Services</h2>
        <div className="service-cards">
            <ServiceCard title="Web Development" description="Building responsive and modern web applications..." />
            <ServiceCard title="Mobile Development" description="Creating mobile applications for Android and iOS..." />
            <ServiceCard title="UI/UX Design" description="Designing user-friendly and aesthetic interfaces..." />
            <ServiceCard title="SEO Optimization" description="Improving search engine rankings and visibility..." />
            <ServiceCard title="Cloud Services" description="Providing scalable and reliable cloud solutions..." />
            <ServiceCard title="Consulting" description="Offering expert advice and solutions for your business..." />
        </div>
    </section>
);

const ContactSection: React.FC = () => (
    <section className="contact">
        <h2>Contact Me</h2>
        <form className="contact-form">
            <input type="text" placeholder="Your Name" required />
            <input type="email" placeholder="Your Email" required />
            <textarea placeholder="Your Message" required></textarea>
            <button type="submit">Send Message</button>
        </form>
    </section>
);

export default HomePage;
